#!/bin/bash

# Set current directory to the directory this script is in
SCRIPT=$(readlink -f "$0")
SCRIPT_DIR=$(dirname "$SCRIPT")
cd $SCRIPT_DIR

PROPOSAL="(record {
        title = \"Update logo\";
        url = \"https://github.com/jamesbeadle/OpenFPL\";
        summary = \"Update logo\";
        action = opt variant {
            ManageSnsMetadata  = record {
                url = opt \"https://openfpl.xyz/\";
                logo  = opt \"data:image/png;base64,\";
                name = null;
                description  = null;
            }
        }
 })"

../utils/submit_proposal.sh "$PROPOSAL"